import React from "react";
import TaskItem from "../TaskItem";

const TaskList = props => {
  return (
    <div>
      <TaskItem
        toggleTodoDone={props.toggleTodoDone}
        removeTodo={props.removeTodo}
        todos={props.todos}
      />
    </div>
  );
};

export default TaskList;
